def isSpecialPalindrome(n, s): # O(1)
    if (n <= 1):
        return True

    if (n%2 != 0):
        mid = s[n//2]
    else:
        mid = None

    uniqueLetters = set(s)
    if len(uniqueLetters) < 2:
        return True
    if len(uniqueLetters) > 2:
        return False
    if mid == s[0] or mid == None:
        return False
    return True

# Complete the substrCount function below.
def substrCount(n, s):
    count = n
    if (len(set(s)) == 1):
        return count 
    for i in range(n):
        # a, b, a, b, a
        for j in range(i+2, n+1, 2): # O((n-i-1)/2)
            # a, b, a
            # [a,b,a]
            # [a,b,a,b]
            # [a,b,a,b,a]
            word1 = s[i:j]
            word2 = s[i:j+1]
            # print(word1,word2)
            if (isSpecialPalindrome(len(word1),word1)):
                # print(word1)
                count += 1
            if (len(word2) > 1 and isSpecialPalindrome(len(word2),word2)):
                # print(word2)
                count += 1
    return count

def substrCount(n, s):
    l = []
    count = 0
    cur = None

    # 1st pass
    for i in range(n):
        if s[i] == cur:
            count += 1
        else:
            if cur is not None:
                l.append((cur, count))
            cur = s[i]
            count = 1
    l.append((cur, count))

    ans = 0
		
    # 2nd pass
    for i in l:
        ans += (i[1] * (i[1] + 1)) // 2

    # 3rd pass
    for i in range(1, len(l) - 1):
        if l[i - 1][0] == l[i + 1][0] and l[i][1] == 1:
            ans += min(l[i - 1][1], l[i + 1][1])

    return ans

